import { Component, OnInit } from '@angular/core';
import { DataService } from '../services/video.service';
import { Video } from '../models/video.model';

@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.css']
})
export class DashboardComponent implements OnInit {

  // All categories with video list and stats
  categories: { name: string, percentage: number, count: number, videos: Video[] }[] = [];
  groupedVideos: { [category: string]: Video[] } = {};

  // Selected badge
  selectedCategory: string | null = null;
  selectedStat: { name: string, percentage: number, count: number,totalVideos: number } | null = null;
  filteredVideos: Video[] = [];

  totalVideos = 0;

  constructor(private youtubeService: DataService) {}

  ngOnInit(): void {
  console.log('Calling backend...');  
  this.youtubeService.getGroupedCategoryData().subscribe(data => {
    this.groupedVideos = data;
    console.log('âœ… Processed backend data:', data);
     const iconMap: { [category: string]: string } = {
        Comedy: 'laugh',
        Sports: 'football-ball',
        Politics: 'landmark',
        Education: 'book-open',
        Music: 'music'
        // Add more as needed
      };

    this.totalVideos = Object.values(this.groupedVideos).reduce((sum, videos) => sum + videos.length, 0);

    this.categories = Object.entries(this.groupedVideos).map(([name, videos]) => ({
      name, 
      count: videos.length,
      iconName: iconMap[name] || 'film',
      percentage: Math.round((videos.length / this.totalVideos) * 100),
      videos
    }));
    console.log('ðŸ§¾ Categories created:', this.categories);
  });
}

  onCategorySelected(categoryName: string): void {
    this.selectedCategory = categoryName;

    const stat = this.categories.find(c => c.name === categoryName);
    if (stat) {
      this.selectedStat = {
        totalVideos: this.totalVideos,
        name: stat.name,
        count: stat.count,
        percentage: stat.percentage
      };
      this.filteredVideos = stat.videos;
    } else {
      this.selectedStat = null;
      this.filteredVideos = [];
    }
  }


}
<!-- TOP ROW: All categories -->
 <h1>Dashboard Loaded</h1>
<!-- <div *ngIf="categories.length === 0">No categories yet</div> -->
<div class="category-top-row">
  <app-category-badge
    *ngFor="let c of categories"
    [category]="c.name"
    [percentage]="c.percentage"
    [count] ="c.count"
    [totalVideos] = "totalVideos"
    [iconName]="c.iconName"
    (badgeClick)="onCategorySelected(c.name)">
  </app-category-badge>
</div>

<!-- MAIN CONTENT: Selected badge on left, videos on right -->


<div class="selected-view" *ngIf="selectedCategory">
  <div class="selected-badge">
    <app-category-badge
      [category]="selectedCategory"
      [percentage]="selectedStat?.percentage || 0">
    </app-category-badge>
    <div class="details">
      <div><strong>Percent:</strong> {{ selectedStat?.percentage }}%</div>
      <div><strong>Videos:</strong> {{ selectedStat?.count }}/{{ totalVideos }}</div>
    </div>
  </div>

  <div class="video-list-section">
    <app-video-list [videos]="filteredVideos"></app-video-list>
  </div>
</div>
